import React from "react";

import { pencil } from "../../../assets/index";

const InfoBlock = ({ data, children, section, styles }) => {
  return (
    <div
      style={{ height: 50 + "vh", marginTop: 10 + "%" }}
      className="info-block"
    >
      <h1>{section}</h1>
      <div className="data">
        <button className="info">
          <img src={pencil} />
        </button>
        {data && (
          <ul>
            {data.map((d) => (
              <li>{d}</li>
            ))}
          </ul>
        )}
      </div>
      {children}
    </div>
  );
};

export default InfoBlock;
